import logo from './logo.svg';
import React from 'react';
import './App.css';

class App extends React.Component{
  render(){
    return(
      <div id="task-container">
        <div id="form-wrapper">
          <form name="task-form">
            <div className="flex-wrapper">
              <div style={{flex:6}}>
              <input type="text" className="form-control" id="title" placeholder=""></input>
              </div>
              <div style={{flex:1}}>
                <input type="submit" id="submit" className="btn btn-warning"></input>
              </div>
            </div>
          </form>
        </div>
      </div>
    )
  }
}

export default App;
